import './App.css';
import { Component } from 'react';

class App extends Component{
  constructor(props){
    super(props);
    this.state = {
      posts: []
    };
  }

  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/posts')
       .then((response) => response.json())
       .then((data) => this.setState({ posts: data }))
       .catch((error) => console.log(error));
 }

